import React from 'react';
import "./Home.css";
import bgImage from './bg.jpg';

class Home extends React.Component{

  render() {
    return (
      <section className='container'>
        <img src={bgImage} alt='home_img'/>
        <span className="home__title">
          <h1>#ZEROWASTE</h1>
          <h3>버려진 플라스틱에 새로운 생명을 불어넣은 패션 기업들</h3>
        </span>
      </section> 

    );
  }
} 

export default Home;
